El medio de investigación El Faro publicó la noche del jueves un reportaje, que cita documentos oficiales y declaraciones de un líder de la pandilla, que señala que el Ejecutivo lleva negociando con la MS13 desde junio pasado y que el pacto incluye favores electorales para los comicios del 2021.

“Las pruebas de que el Gobierno de Nayib Bukele está negociando con la Mara Salvatrucha 13 son documentos oficiales del propio Gobierno”, abre el texto que ha sacudido la política del país centroamericano.

